import React from 'react';
import { IonContent, IonHeader, IonPage, IonTitle, IonToolbar, IonButton, IonLabel, IonIcon, IonList, IonItem } from '@ionic/react';
import { settingsOutline, personCircleOutline } from 'ionicons/icons';
import ExploreContainer from '../components/ExploreContainer';
import './Home.css';

const Home: React.FC = () => {
  return (
    <IonPage>
      <IonContent>
        <IonHeader collapse="condense">
          <IonToolbar>
            <IonTitle size="large">Tab 3</IonTitle>
          </IonToolbar>
        </IonHeader>
        <ExploreContainer name="Tab 3 page" />
        <IonButton routerLink="/profile" fill="clear">    
          <IonIcon icon={personCircleOutline} />      
        </IonButton>
        <IonButton routerLink="/settings">
          <IonIcon icon={settingsOutline} />
        </IonButton>
        <IonList>
          <IonItem routerLink="/settings">
            <IonLabel>User 1</IonLabel>
          </IonItem>
          <IonItem routerLink="/profile">
            <IonLabel>User 2</IonLabel>
          </IonItem>
        </IonList>
      </IonContent>
    </IonPage>
  );
};

export default Home;
